* {
    margin: 0;
    padding: 0;
    box-sizing: border-box;
}

html, body {
    width: 100%;
    height: 100%;
    font-family: 'Montserrat', sans-serif;
    color: rgb(240, 240, 240);
    background-color: #141414;
    position: relative;
    display: flex;
    justify-content: center;
    overflow: hidden;
}

    .OverFlow {
        overflow-y: scroll;
    }
    .BgLight {
        background-color: rgb(240, 240, 240);
    }

h1 {
    font-family: aktiv-grotesk-condensed, sans-serif;
    font-weight: 900;
    font-style: normal;
    text-transform: uppercase;
}

ul {
    list-style-type: none; 
}

a {
    text-decoration: none;
    color: #E6E6E6;
}

.GroundZero {
    width: 100%;
    max-width: 1902px;
    height: 100%;
    position: relative;
    background-color: transparent;
    opacity: 0;
}

.ScrollBar {
    position: fixed;
    width: 20px;
    height: 100%;
    right: 0;
    top: 0;
    bottom: 0;
    z-index: 1;
    opacity: 0;
    background-color: #141414;
}

