/* --- Navigation ------------ */

.Menu-Icon {
    width: 50px;
    height: 120px;
    position: fixed;
    top: 0;
    right: 60px;
    display: flex;
    justify-content: flex-end;
    align-items: center;
    z-index:500;
    transition: all .6s ease-in-out;

}

    .Menu-Icon-Wrap {
        width: 50px;
        height: 12px;
        position: relative;
        cursor: pointer;
    }

        .Menu-Icon-Bar {
            width: 100%;
            height: 2px;
            background-color: rgb(240, 240, 240);
            position: absolute;
            transition: all;
        }

            .Menu-Icon-Bar1 {
                top: 0;
            }
            .Menu-Icon-Bar2 {
                top: 100%;
            }

.Portfolio-Logo {
    height: 120px;
    position: fixed;
    top: 0;
    left: 40px;
    display: flex;
    justify-content: center;
    align-items: center;
    z-index:500;
    transition: all .6s;
}



@media screen and (max-width: 650px){
    .Portfolio-Logo {
        left: 30px;
        height: 100px;
    }
    .Menu-Icon {
        right: 35px;
        height: 100px;
    }
    .Menu-Icon-Wrap {
        width: 40px;
        height: 10px;
    }
}




//NAV ----------------------------
.Nav {
    width: 100%;
    height: 100vh;
    background-color: #000;
    position: fixed;
    top: 0;
    left: 0;
    right: 0;
    bottom: 0;
    opacity: 0;
    z-index: 550;
    display: none;
    justify-content: center;
    transition: all;
}

    .Nav-Wrap {
        width: 100%;
        max-width: 1920px;
        height: 100%;
        padding: 0 10%;
        position: relative;
    }

        .Nav-Exit {
            width: 50px;
            height: 120px;
            position: fixed;
            top: 0;
            right: 60px;
            display: flex;
            justify-content: flex-end;
            align-items: center;
            z-index:500;
            opacity: 0;
            transition: all .6s ease-in-out;

        }

            .Nav-Exit-Wrap {
                width: 50px;
                height: 12px;
                display: flex;
                align-items: center;
                position: relative;
                cursor: pointer;
            }

                .Nav-Exit-Bar {
                    width: 100%;
                    height: 2px;
                    background-color: rgb(240, 240, 240);
                    position: absolute;
                    transition: all;
                }

        .Nav-Divide-Line {
            position: absolute;
            left: 60%;
            transform: translateX(-40%);
            top: -100%;
            height: 100vh;
            width: 1px;
            opacity: 0;
            background-color: rgb(86, 86, 86);
            transition: all;
        }

        .Nav-List {
            padding-top: 150px;
            opacity: 0;
            transition: all;
        }

            .Nav-List-Item {
                margin-bottom: 30px;
            }

                .Nav-Link {
                    font-size: 90px;
                    font-family: aktiv-grotesk-condensed, sans-serif;
                    font-weight: 900;
                    font-style: normal;
                    text-transform: uppercase;
                    transition: all;
                }
                    #Nav-Link3 {
                        cursor: pointer;
                    }

                    .Nav-Link-Number {
                        font-size: 10px;
                        font-weight: 300;
                        margin-left: -10px;
                        margin-bottom: -10px;
                        color: rgb(167, 167, 167);
                        }

        .Nav-Info {
            position: absolute;
            bottom: 0;
            transform: translateY(-24%);
            right: 0;
            padding-right: 120px;
            opacity: 0;
            transition: all;
        }

            .Nav-Info-Wrap {
                width: 100%;
                height: 100%;
                position: relative;

            }

                .Nav-Info-Name {
                    font-size: 26px;
                    white-space: nowrap;
                    font-weight: 700;
                    margin-bottom: 5px;
                    color: #b8b8b8;
                }

                .Nav-Info-Title {
                    font-size: 16px;
                    white-space: nowrap;
                    margin-bottom: 5px;
                    color: #828282;
                    font-weight: 300;
                }
                .Nav-Info-Portfolio{
                    font-size: 16px;
                    white-space: nowrap;
                    margin-bottom: 50px;
                    color: #828282;
                    font-weight: 300;
                }

                .Nav-Info-Links {
                    margin-bottom: 10px;
                }

                .Nav-Info-Link {
                    font-size: 14px;
                    white-space: nowrap;
                    font-weight: 300;
                    color: #828282;
                    margin-right: 5px;
                }
                    .Nav-Info-Link:hover {
                        color: rgb(240, 240, 240);
                    }

                .Nav-Info-Email {
                    font-size: 14px;
                    white-space: nowrap;
                    margin-bottom: 30px;
                    color: #828282;
                    font-weight: 300;
                }

        .Nav-Projects-Close {
            position: absolute;
            left: 50%;
            top: 10%;
            font-size: 12px;
            display: none;
            opacity: 0;
            transition: all;
            cursor: pointer;
        }

        .Nav-Projects-List {
            position: absolute;
            top: 150px;
            opacity: 1;
            display: none;
            transition: all;
        }       

            .Nav-Projects-List-Item {
                margin-bottom: 25px;
                opacity: 0;
                transition: all;
            }

                .Nav-Projects-Link {
                    font-size: 90px;
                    font-family: aktiv-grotesk-condensed, sans-serif;
                    font-weight: 900;
                    font-style: normal;
                    text-transform: uppercase;
                    white-space: nowrap;
                    transition: all;
                }

                    .Nav-Projects-Link-Description {
                        font-size: 12px;
                        text-transform: uppercase;
                        font-weight: 300;
                        white-space: nowrap;
                        margin-top: -10px;
                        padding-left: 2px;
                    }




@media screen and (max-height: 900px){
    .Nav-Projects-Link {
        font-size: 70px;
    }
}  

@media screen and (max-height: 750px){
    .Nav-List {
        padding-top: 100px;
    }
    .Nav-Link {
        font-size: 50px;
    }
    .Nav-Projects-List {
        top: 80px;
    }
    .Nav-Projects-Link {
        font-size: 50px;
    }
    .Nav-Projects-Link-Description {
        font-size: 10px;
        margin-top: -5px;
    }
    .Nav-Info-Name {
        font-size: 18px;
    }

    .Nav-Info-Title {
        font-size: 14px;
    }
    .Nav-Info-Portfolio{
        font-size: 14px;
    }

    .Nav-Info-Links {
        font-size: 12px;
    }
    .Nav-Info-Email {
        font-size: 12px;
    }
    .Nav-Projects-Close {
        left: 10%;
        top: 50px;
    }
}

@media screen and (max-height: 550px){
    .Nav-Projects-Link {
        font-size: 30px;
    }
}
@media screen and (max-height: 500px){
    .Nav-List {
        padding-top: 80px;
    }
    .Nav-Link {
        font-size: 30px;
    }


}

@media screen and (max-width: 1100px){
    .Nav-Info {
        display: none;
    }
    .Nav-Divide-Line {
        display: none;
    }
    .Nav-Projects-Close {
        left: 10%;
    }
}

@media screen and (max-width: 650px){
    .Nav-Exit {
        right: 35px;
        height: 100px;
    }
    .Nav-Exit-Wrap {
        width: 40px;
        height: 10px;
    }
    .Nav-Link {
        font-size: 50px;
    }
    .Nav-Projects-Link {
        font-size: 50px;
    }
    .Nav-Projects-Link-Description {
        font-size: 9px;
    }
}







