                }

                    #FooterText2 {
                        margin-left: 140px;
                    }

                .Bold {
                    font-weight: 700;
                }

                .HeartIcon {
                    width: 15px;
                    height: 12px;
                    margin: 0 3px;
                    background: url('../Assets/Icons/HeartIcon.svg');
                    background-position: center;
                    background-size: contain;
                    background-repeat: no-repeat;
                }

